import { Tabs } from 'flowbite-react';
import React from 'react';
import { LuEdit, LuHeart } from "react-icons/lu";
import { IoImageOutline } from "react-icons/io5";
import "./style.scss";
import { Link } from 'react-router-dom';

const TabProfile = () => {
    return (
        <Tabs.Group style='underline'>
            <Tabs.Item
                active
                icon={LuEdit}
                title={<Link to=":slugUser/posts"> Bài viết</Link>}>
            </Tabs.Item>

            <Tabs.Item
                icon={LuHeart}
                title={<Link to=":slugUser/favourites">Yêu thích</Link>}>

            </Tabs.Item>

            <Tabs.Item
                icon={IoImageOutline}
                title={<Link to=":slugUser/photos">Hình ảnh</Link>}>
            </Tabs.Item>
        </Tabs.Group >
    );
};

export default TabProfile;
